import React from 'react';
import MyInput from './MyInput'
import './Login.css'

let dadosLogin = {}

function changeValue (campo, valor) {
    dadosLogin[campo] = valor
    console.log(dadosLogin[campo])
}

function Login() {
    return (
        <div className="Login-card">
            <span className="Title">Nome Sistema</span>
            <MyInput onChange={event => onChange(changeValue('Nome', event.target.value))} label={'Nome'} value={dadosLogin.nome}/>
            <MyInput label={'Senha'} value={10}/>
            <button className="Botao-entrar">Entrar</button>
        </div>
    );
}

export default Login;
